class Solution(object):
    def minCut(self, s):
        """
        :type s: str
        :rtype: int
        """
        # pre-process
        L = len(s)
        valid = [[True] * L for _ in range(L)]

        for k in range(1, L):
            for x in range(L):
                if x + k < L:
                    valid[x][x + k] = ((s[x] == s[x + k]) and valid[x + 1][x + k - 1])

        # dp[x] - the min cut for a palindrome partitioning of s[: x + 1]
        dp = [L] * L

        # dp transfer
        for x in range(L):
            if valid[0][x]:
                dp[x] = 0
                continue
            for y in range(x):
                if valid[y + 1][x]:
                    dp[x] = min(dp[x], dp[y] + 1)

        return dp[L - 1]


s = "aab"
s = "a"
s = "ab"
s = "abbabababababababb"
s = ""
s = ""

solution = Solution()
print(solution.minCut(s))
